import  { useState } from 'react';
import './Event.css'
//  import Navigation from './Navigation';
  // import Sample from '../Components/Sample';
  // import Sample1 from '../Components/Sample1';
 import { Link } from 'react-router-dom';
// import './PP.css';

const PP = () => {
  const [searchInput, setSearchInput] = useState('');
  // const [sortBy, setSortBy] = useState('');

  // Sample data array
  const sampleData = [
    {
      title: 'Product Launches',
      image: 'https://media.istockphoto.com/id/1145940285/photo/product-launch-motivational-business-marketing-words-quotes-concept.jpg?s=612x612&w=0&k=20&c=a61cqMQN5YN0O9KkcypP4rdLloaVNyGIwBUoQ8IUke0=',
     
    
    },
    {
      title: 'Employee Milestones',
      image: 'https://www.shutterstock.com/image-vector/reaching-milestone-business-businessman-planting-260nw-2027989904.jpg',
    
    
    },
    // Add more sample data items as needed
    {
      title: 'Innovation Day',
      image: 'https://www.shutterstock.com/image-vector/world-creativity-innovation-day-poster-260nw-2275725253.jpg',
    
    
    },
    {
      title: 'Employee Appreciation Day',
      image: 'https://img.freepik.com/free-vector/flat-employee-appreciation-day-vertical-poster-template_23-2149288445.jpg',
     
    },
    {
      title: 'Awards and ceremony',
      image: 'https://imgscf.slidemembers.com/docs/1/1/989/employee_award_ceremony_outline_ppt_presentation_988068.jpg',
     
    },
    {
      title: 'Inovation Day',
      image: 'https://www.planbox.com/wp-content/uploads/2018/09/BlogGraphic_1000_PlanBox_2-2.png',
    
    
    },
    {
      title: 'walk to work day',
      image: 'data:image/png;base64,',
    
   
    },
    {
      title: 'world health day',
      image: 'https://img.freepik.com/free-vector/gradient-world-health-day-social-media-post-template_23-2149309513.jpg',
     
   
    },
    {
      title: 'Administrative professional day',
      image: 'data:image/jpeg;base64,',
    
    
    },
    {
      title: 'National Health and Fitness Day',
      image: 'data:image/png;base64,',
   
    },
  ];

  // Function to handle search input change
  const handleSearchInputChange = (event) => {
    setSearchInput(event.target.value);
  };

  // Function to sort items based on "Employee Milestones"
  const sortItems = () => {
    // Sort by title "Employee Milestones" and move it to the top
    const sortedData = [...sampleData].sort((a, b) => {
      if (a.title === 'Employee Milestones') return -1;
      if (b.title === 'Employee Milestones') return 1;
      return 0;
    });
    // Update state with sorted data
  //  setSampleData(sortedData);
  };

  // Filter and map the sampleData based on search input
  const filteredData = sampleData.filter((item) =>
    item.title.toLowerCase().includes(searchInput.toLowerCase())
  );

  return (
    <>
      <div>
      </div>
      <br />
      <br />
      <br />
      <br />
      <br />
      <div className='kol23'>
        {/* Search bar */}
        <input
          type='text'
          placeholder='Search...'
          value={searchInput}
          onChange={handleSearchInputChange}
        />
        {/* Sort button */}
        <button onClick={sortItems} className='jack38'>Sort</button>

        {/* Item list */}
        {filteredData.map((item, index) => (
          <div className="flex" key={index}>
            <div className="max-w-md md:max-w-2xl px-2">
              <div className="bg-white shadow-xl rounded-lg overflow-hidden md:flex">
                <div className="bg-cover bg-bottom h-56 md:h-auto md:w-56" style={{backgroundImage: `url(${item.image})`}}>
                </div>
                <div>
                  <div className="p-4 md:p-5">
                    <p className="font-bold text-xl md:text-2xl">{item.title}</p>
                    <p className="text-gray-700 md:text-lg">{item.description}</p>
                  </div>
                  <div className="p-4 md:p-5 bg-gray-100">
                    <div className="sm:flex sm:justify-between sm:items-center">
                      <div>
                        {/* <div className="text-lg text-gray-700"><span className="text-gray-900 font-bold">{item.price}</span> per person*</div> */}
                        <div className="flex items-center">
                          <div className="flex inline-flex -mx-px">
                            <svg className="w-4 h-4 mx-px fill-current text-green-600" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 14 14">
                              <path d="M6.43 12l-2.36 1.64a1 1 0 0 1-1.53-1.11l.83-2.75a1 1 0 0 0-.35-1.09L.73 6.96a1 1 0 0 1 .59-1.8l2.87-.06a1 1 0 0 0 .92-.67l.95-2.71a1 1 0 0 1 1.88 0l.95 2.71c.13.4.5.66.92.67l2.87.06a1 1 0 0 1 .59 1.8l-2.3 1.73a1 1 0 0 0-.34 1.09l.83 2.75a1 1 0 0 1-1.53 1.1L7.57 12a1 1 0 0 0-1.14 0z" />
                            </svg>
                            {/* Repeat the star SVG elements for rating */}
                          </div>
                          <div className="text-gray-600 ml-2 text-sm md:text-base mt-1">{item.reviews} reviews</div>
                        </div>
                      </div>
                      <Link to="/Bookevent"> 
            <button className="mt-3 sm:mt-0 py-2 px-5 md:py-3 md:px-6 bg-indigo-700 hover:bg-indigo-600 font-bold text-white md:text-lg rounded-lg shadow-md">Book now</button>
                       </Link> 
                    </div>
                    <div className="mt-3 text-gray-600 text-sm md:text-base">*Prices may vary depending on selected date.</div>
                  </div>
                </div>
              </div>
            </div>
          </div>
        ))}
      </div>
    </>
  );
};

export default PP;

